import React from "react";

function Sections(props){
    return (
        <div>
            <h5>{this.head}</h5>
            <p>{this.para}</p>
        </div>
    )   
}

const AboutUs = () => {
    return ( 
        <div style={{ paddingTop: "120pt", paddingBottom: "120pt", background: "#010101", color:"#eeeeee"}}>
            <h1>How We Work</h1>
            <Sections head="you" />
            <Sections head="no" />
        </div>
     );
}

export default AboutUs;
